        Pekerjaan : Mahasiswa/admin sekolah SMAN 1 Glagah<br/>
        Hobi : Membaca dan Memasak<br/>
        NIM : 1118101570<br/>
        JURUSAN : S1 TEKNIK INFORMATIKA - MALAM 2018
        </h4>
    </Layout>
);

export default Index;
